import { FC } from "react";
import "./navbar.css"

const Navbar: FC = () => {
    return (
        <ul id="navbar" className="sticky">
            <li><a href="/">/home/david</a></li>
            <li><a href="#dev">~/dev</a></li>
            <li><a href="#about">~/about-me</a></li>
            <li><a href="#contact">~/contact</a></li>
        </ul>
    )
}

export default Navbar;
